import React, {Component} from 'react';
import {
    Toast,
    ToastHeader,
    ToastBody
} from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.min.css';


export default class Calculator extends Component {

    render() {
        return <div>
            <Toast>
                <ToastHeader>
                    Calculadora
                </ToastHeader>
                <ToastBody>
                    Buttons
                </ToastBody>
            </Toast>
        </div>
    }
}
